import React from "react";
import { Link } from "react-router-dom";
const Header = ({ text }) => {
  return (
    <div className="header">
      <span>{text}</span>
      <button>
        <Link to="/">
          <img src="images/quit_btn.png"></img>
        </Link>
      </button>
    </div>
  );
};

export default Header;
